contracts/callback.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

contract CallbackExample {
    // Тип функции, принимающей uint и возвращающей bool
    function (uint) external returns (bool) callback;

    function setCallback(function (uint) external returns (bool) _callback) public {
        callback = _callback;
    }

    function executeCallback(uint value) public returns (bool) {
        return callback(value);
    }
}

contract MyContract {
    function myCallback(uint value) external pure returns (bool) {
        return value > 10;
    }
}

